            marker_cluster_557ca44e3c7f4e22c4169ddaa448e123.options.iconCreateFunction =
                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';
    if (t.indexOf('cat-pos') !== -1 || cls.indexOf('cat-pos') !== -1) { pos += 1; }
  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';
    if (t.indexOf('cat-pos') !== -1 || cls.indexOf('cat-pos') !== -1) { pos += 1; }
  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

            marker_cluster_2926326fe67ac333fc90eccf411f2ad4.options.iconCreateFunction =
                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';
    if (t.indexOf('cat-pos') !== -1 || cls.indexOf('cat-pos') !== -1) { pos += 1; }
  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

            marker_cluster_ff2bf4c2c46cdc64e420946d2691097a.options.iconCreateFunction =
                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';
    if (t.indexOf('cat-pos') !== -1 || cls.indexOf('cat-pos') !== -1) { pos += 1; }
  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

            marker_cluster_d42ce5ab5e1add9df57379bebb1709af.options.iconCreateFunction =
                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';
    if (t.indexOf('cat-pos') !== -1 || cls.indexOf('cat-pos') !== -1) { pos += 1; }
  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';

  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

            marker_cluster_df9a32e16d7e08cc06e3b3f533f747ba.options.iconCreateFunction =
                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';
    if (t.indexOf('cat-pos') !== -1 || cls.indexOf('cat-pos') !== -1) { pos += 1; }
  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

            marker_cluster_13c362fb2c642a4d1a6738233fc5bacd.options.iconCreateFunction =
                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';
    if (t.indexOf('cat-pos') !== -1 || cls.indexOf('cat-pos') !== -1) { pos += 1; }
  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

            marker_cluster_a2f0d42108a321c8e4c68a748cac7abf.options.iconCreateFunction =
                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';
    if (t.indexOf('cat-pos') !== -1 || cls.indexOf('cat-pos') !== -1) { pos += 1; }
  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

            marker_cluster_70790a635178300fbf9200b1dd0334c9.options.iconCreateFunction =
                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';
    if (t.indexOf('cat-pos') !== -1 || cls.indexOf('cat-pos') !== -1) { pos += 1; }
  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';
    if (t.indexOf('cat-pos') !== -1 || cls.indexOf('cat-pos') !== -1) { pos += 1; }
  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';

  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};

            marker_cluster_c45c7053a25315afa785171ad8774423.options.iconCreateFunction =
                function(cluster) {
  var markers = cluster.getAllChildMarkers();
  var total = markers.length, pos = 0;

  for (var i = 0; i < total; i++) {
    var mk = markers[i];
    var t = (mk && mk.options && mk.options.title) ? mk.options.title : '';
    var cls = (mk && mk.options && mk.options.icon && mk.options.icon.options && mk.options.icon.options.className) ? mk.options.icon.options.className : '';
    if (t.indexOf('cat-pos') !== -1 || cls.indexOf('cat-pos') !== -1) { pos += 1; }
  }

  var ratio = total === 0 ? 0 : pos / total;          // '적정' 비율
  var pct   = Math.round(ratio * 100);                // 퍼센트 표기

  // '적정'↑ => 초록(120deg), '초과'↑ => 빨강(0deg)
  var hue = Math.round(120 * ratio);                  // 0~120
  var bg  = 'hsl(' + hue + ', 80%, 45%)';

  // 기본 클래스 유지, 색은 내부 div의 인라인 스타일로 지정
  var classList = 'marker-cluster marker-cluster-small';

  var html = '<div style="background:' + bg + '; color:#fff;">'
           +   '<span>' + total + '</span>'
           +   '<small>' + pct + '%</small>'
           + '</div>';

  return new L.DivIcon({
    html: html,
    className: classList,
    iconSize: new L.Point(44, 44)
  });
};
